import React from 'react';
import {BrowserRouter as Router, Route, Navigate, Switch} from 'react-router-dom';
import Users from './users/pages/users';

function App() {
  return <Router>
    <Switch>
    <Route path="/" exact>
      <Users></Users>
    </Route>
    <Navigate to="/" />
    </Switch>
  </Router>;
};

export default App;
